"""3. Откройте существующий файл titanic.txt, запишите последние две строки из этого файла в новый файл some_info_about_titanic.txt"""

# (с открытием <файла> на чтение) как данные
with open("titanic.txt", "r") as data:
  # считай данные с файла как список со строками
  file_data = data.readlines()

# запиши из этих данных только последние две строки
last_items = file_data[-2:]

# (с открытием <файла> на запись) как выходной файл
with open("some_info_about_titanic.txt", "w") as target_file:
  # запиши наши отфильтрованные данные
  target_file.writelines(last_items)

"""4. Есть файл log.txt. Откройте его, найдите только строки, в которых выведены ошибки. Эти строки запишите в отдельный файл errors.txt"""

with open("log.txt", "r") as log_file:
  file_info = log_file.readlines()

errors_list = []

for row in file_info:
  if "error" in row.lower():
    errors_list.append(row)

with open("errors.txt", "x") as errors_file:
  result = errors_file.writelines(errors_list)

"""5. Пользователь вводит разные данные с клавиатуры. Если он вводит строку - записать её в файл user_response.txt. Если вводит число - пропускать его."""

